// SPDX-License-Identifier: MIT

pragma solidity 0.8.7;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/cryptography/draft-EIP712.sol";

contract AirDrop is EIP712 {

    mapping(address=>uint256)public balanceOfTokens;
    mapping(address=>uint256)public balanceOfEther;

    address private _owner;
    bytes32 public constant DROP_HASH =
        keccak256(
            "Drop(uint256 amount_, address recepient_, uint256 deadline_)"
        );

    IERC20 private _token;

    modifier onlyOwner() {
        require(_owner == msg.sender, "You are not owner");
        _;
    }

    constructor(address token_) EIP712("AirDrop", "3") {
        _token = IERC20(token_);
        _owner = msg.sender;
    }

    function depositTokens(uint256 amount_) external onlyOwner {
        _token.transfer(address(this), amount_);
    }

    function depositEther() external payable onlyOwner returns(uint256) {
        return uint256(msg.value);
    }

    function dropTokens(
        address recepients_,
        uint256 amount_,
        uint256 deadline_,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external onlyOwner {
        uint256 deadline = (block.timestamp + (deadline_ * 1 days));
        bytes32 structHash = keccak256(
            abi.encode(DROP_HASH, recepients_, amount_, deadline)
        );
        bytes32 digest = _hashTypedDataV4(structHash);

        require(_owner == ECDSA.recover(digest, v, r, s), "invalid signature");
        require(
            block.timestamp < deadline,
            "MyFunction: signed transaction expired"
        );

        balanceOfTokens[recepients_] += amount_;
        _token.approve(recepients_, amount_);

    }

    function dropEther(
        address recepients_,
        uint256 amount_,
        uint256 deadline_,
        uint8 v,
        bytes32 r,
        bytes32 s
    ) external onlyOwner {
        uint256 deadline = (block.timestamp + (deadline_ * 1 days));
        bytes32 structHash = keccak256(
            abi.encode(DROP_HASH, recepients_, amount_, deadline)
        );
        bytes32 digest = _hashTypedDataV4(structHash);

        require(_owner == ECDSA.recover(digest, v, r, s), "invalid signature");
        require(
            block.timestamp < deadline,
            "MyFunction: signed transaction expired"
        );

        balanceOfEther[recepients_] = amount_;
    }

    function updateTokenAddress(address token_) external onlyOwner {
        _token = IERC20(token_);
    }

    function withdrawTokens() external onlyOwner {
        _token.transfer(msg.sender, _token.balanceOf(address(this)));
    }

    function withdrawEther() external onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }

    function claimToken() external {
        uint256 amountOfTokens = balanceOfTokens[msg.sender];
        require(amountOfTokens > 0);
        balanceOfTokens[msg.sender] -= amountOfTokens;
        _token.transfer(msg.sender, amountOfTokens);
    }

    function claimEther() external {
        uint256 amountOfEther = balanceOfEther[msg.sender];
        require(amountOfEther > 0);
        balanceOfEther[msg.sender] -= amountOfEther;
        payable(msg.sender).transfer(amountOfEther);
    }
}
